import { AppBar, Toolbar, makeStyles ,Typography} from '@material-ui/core';
import { NavLink ,Link} from 'react-router-dom';

const useStyle = makeStyles({
    header: {
        background: '#111111'
    },
    tabs: {
        color: '#FFFFFF',
        marginRight: 30,
        textDecoration: 'none',
        fontSize: 25,
    },
    title:{
         marginLeft:300,

    }
})

const NavBar = () => {
    const classes = useStyle();
    return (
        <AppBar position="static" className={classes.header}>
            <Toolbar>
                <NavLink className={classes.tabs} to="./" exact>Home</NavLink>
                <Link to="/add" cclassName={classes.tabs} >HAdd User</Link>
                <NavLink className={classes.tabs} to="/all" exact>All Users</NavLink>
                {/* <NavLink className={classes.tabs} to="/add" exact>Add User</NavLink> */}
                <Typography variant="h2" component="h2" className={classes.title}>USER DETAILS PAGE</Typography>
            </Toolbar>
        </AppBar>
    )
}

export default NavBar;
